def get_common_var(a, b, x1, x2):
    x1ma = -a + x1
    x2mb = -b + x2
    x1pa = a + x1
    x2pb = b + x2
    aa = a * a
    bb = b * b
    Q_x2mb = x2mb * x2mb
    Q_x1ma = x1ma * x1ma
    Q_x1pa = x1pa * x1pa
    Q_x2pb = x2pb * x2pb
    Q_x1ma_p_Q_x2mb = Q_x1ma + Q_x2mb
    Q_x1pa_p_Q_x2mb = Q_x1pa + Q_x2mb
    return x1ma, x2mb, x1pa, x2pb, aa, bb, Q_x2mb, Q_x1ma, Q_x1pa, Q_x2pb, Q_x1ma_p_Q_x2mb, Q_x1pa_p_Q_x2mb

