    #                                                        # dx    dy                         dx    dy                         dx    dy
    #         C_toeplitz_coe[i * nx + j] = sig_zz_Dz_11(a, b, dx1k, dyk1) + sig_zz_Dz_12(a, b, dx1k, dyk2) + sig_zz_Dz_13(a, b, dx1k, dyk3) + \
    #                                      sig_zz_Dz_21(a, b, dx2k, dyk1) + sig_zz_Dz_22(a, b, dx2k, dyk2) + sig_zz_Dz_23(a, b, dx2k, dyk3) + \
